import React from 'react'
import "./explore.css"
import Card from "../populatecard/populateCard";
import {Link} from 'react-router-dom';
const Explore = () => {
    return (
        <>
        <p>Explore</p>
            <Link to="/details">
                <Card/>
            </Link>
        </>
    )
}

export default Explore
